      "content": "// SPDX-License-Identifier: MIT
pragma solidity >=0.4.23 <0.9.0;

import "AdminControl.sol";

contract NFTRegistry is AdminControl {

    /* ========== Structs and Mappings ========== */

    struct Token {
        address tokenAddress;
        string tokenName;
        uint256 tokenFee;
        uint maxTokensToMint;
    }

    mapping(uint => Token) private tokens;

    /* ========== Registry: Search, Add Token, Remove Token ========== */

    function getToken(uint tokenId) public view returns (address, string memory, uint256, uint) {
        Token storage token = tokens[tokenId];
        if (token.tokenAddress == address(0)) {
            return (address(0), "NFT not found", 0, 0);
        }
        return (token.tokenAddress, token.tokenName, token.tokenFee, token.maxTokensToMint);
    }

    function setToken(uint tokenId, address tokenAddress, string memory tokenName, uint256 tokenFee, uint maxTokenMint) external adminRequired {
        Token storage token = tokens[tokenId];
        token.tokenAddress = tokenAddress;
        token.tokenName = tokenName;
        token.tokenFee = tokenFee;
        token.maxTokensToMint = maxTokenMint;
    }

    function removeToken(uint tokenId) external adminRequired {
        Token storage token = tokens[tokenId];
        if (token.tokenAddress == address(0)) {
            revert("Token not found");
        }
        delete tokens[tokenId];
    }
}

// End of contract "
